import Head from "next/head";
import "global.scss";
import GoogleMaps from "GoogleMaps";
import Subscribe from "Subscribe";
import MakeMark from "MakeMark";
import ActivityArea from "ActivityArea";

const Home = () => (
	<>
		<Head>
			<title>
				Коронавирус в Украине - создано искусственным интеллектом
			</title>
			<link rel="icon" href="coronavirus2.png" />
		</Head>

		<main>
			<section className="mapArea">
				<GoogleMaps />
			</section>

			<section className="mainBlock">
				<MakeMark />

				<ActivityArea />

				<Subscribe />

				{/* <footer>
					<a target="_blank" rel="noopener noreferrer">
						<img
							src="/coronavirus2.png"
							style={{ width: 25 }}
							alt="ZEIT Logo"
						/>
						Только правда
					</a>
				</footer> */}
			</section>
		</main>
	</>
);

export default Home;
